import React, { useEffect, useState } from "react";
import { useNavigate } from "react-router-dom";
import ProfileCard from "./ProfileCard";

function Profile({ currentUser }) {
  const [danceClass, setDanceClass] = useState("");
  const navigate = useNavigate();
  const handleClick = (danceClass) => {
    fetch(`http://localhost:3000/dance_classes/${danceClass}`, {
      method: "DELETE",
    }).then(setDanceClass(danceClass));
  };
  console.log(danceClass);
  return (
    <div>
      <h1>PROFILE</h1>
      <ProfileCard currentUser={currentUser} danceClass={danceClass} />
      <button
        className="px-4 py-1 bg-red"
        onClick={() => handleClick(currentUser.dance_classes[0].id)}
      >
        Drop Class
      </button>
    </div>
  );
}

export default Profile;
